import React from 'react';

function Desplegable() {
    return (
        <div>
            <label>
                <h1> {this.props.id} </h1>
                País:<select >
                    <option value="54">Argentina</option>
                    <option value="57">Colombia</option>
                    <option value="593">Ecuador</option>
                    <option value="34">España</option>
                </select>
            </label>
        </div>
    );
}

export default Desplegable;
